import React from 'react';

const ProviderDetail = () => {
  return (
    <div className="container py-5">
      <div className="row">
        <div className="col-12">
          <h1>Provider Detail Page</h1>
          <p>This page will show detailed information about a specific provider.</p>
          <div className="alert alert-info">
            <strong>Coming Soon:</strong> Provider profile, reviews, contact information, booking options.
          </div>
        </div>
      </div>
    </div>
  );
};

export default ProviderDetail;
